import React from 'react';
import { SectionsContainer, Section } from 'react-fullpage';

function fullPage(props) {
    let options = {
        anchors: ['sectionOne', 'sectionTwo', 'sectionThree'],
    };

    return (
        <SectionsContainer {...options}>
            <Section>
                {/* 내용을 여기에 추가 */}
            </Section>
            <Section>
                {/* 다른 섹션의 내용을 여기에 추가 */}
            </Section>
            <Section>
                {/* 또 다른 섹션의 내용을 여기에 추가 */}
            </Section>
        </SectionsContainer>
    );
}

export default fullPage;
